import React, { useEffect, useState } from 'react';
import ProfileCard from './components/ProfileCard';

function App() {
  const [profileData, setProfileData] = useState(null);

  useEffect(() => {
    const fetchProfileData = async () => {
      try {
        const response = await fetch('url-de-tu-api-que-devuelve-los-datos');
        const data = await response.json();

        // Aquí asumimos que la API devuelve un objeto con los datos del perfil
        const { nombre, apellidos, curso, anoIngreso, notaMedia, fotoUrl } = data;

        setProfileData({
          nombre,
          apellidos,
          curso,
          anoIngreso,
          notaMedia,
          fotoUrl
        });
      } catch (error) {
        console.error('Error al obtener datos del perfil:', error);
      }
    };

    fetchProfileData();
  }, []);

  if (!profileData) {
    return <div>Cargando perfil...</div>;
  }

  return (
    <div className="App">
      <ProfileCard
        nombre={profileData.nombre}
        apellidos={profileData.apellidos}
        curso={profileData.curso}
        añoIngreso={profileData.añoIngreso}
        notaMedia={profileData.notaMedia}
        fotoUrl={profileData.fotoUrl}
      />
    </div>
  );
}

export default App;
